import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import { ArrowBackIos, ArrowForwardIos } from "@material-ui/icons";
import { multiData } from "./data";
import { useRef } from "react";

const Ipl = () => {
  const sliderRef = useRef(null);
  console.log(sliderRef);
  return (
    <div>
      {/* <h1>IPL</h1> */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
        }}
      >
        <h1>Match HightLights</h1>
        <div
          style={{
            display: "flex",
          }}
        >
          <div
            style={{
              width: 40,
              height: 40,
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              marginRight: 10,
              borderRadius: 7,
              boxShadow: "0 1px 3px rgb(0 0 0 / 10%)",
              cursor: "pointer",
            }}
          >
            <ArrowBackIos />
          </div>
          <div
            style={{
              width: 40,
              height: 40,
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              marginRight: 10,
              borderRadius: 7,
              boxShadow: "0 1px 3px rgb(0 0 0 / 10%)",
              cursor: "pointer",
            }}
          >
            <ArrowForwardIos />
          </div>
        </div>
      </div>
      <div style={{ margin: 30 }}>
        <Slider ref={sliderRef} slidesToShow={3} slidesToScroll={2} infinite>
          {multiData.map((item) => (
            <div>
              <img
                src={item}
                alt=""
                style={{
                  width: "100%",
                  height: "170px",
                  objectFit: "contain",
                  marginBottom: "10px",
                }}
              />
            </div>
          ))}
        </Slider>
      </div>
    </div>
  );
};

export default Ipl;
